    const exit = {
        exit: {
        opacity: 0,
        }
    };

    return(
    <div className="thanks-page">
        <div className="thankYou">
            <div className="container" >
                <motion.h1 {...exit}>Thanks for reaching out I'll get back to you as soon as I can !</motion.h1>
                <Link to="/home"> back to home </Link>  
            </div>
       </div>
    </div> 
    )
}

export default Footer;
